import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddBooking = () => {
  const navigate = useNavigate();
  const House_API1 = 'http://26.90.237.200:3000/user/add';
  const House_API2 = 'http://26.90.237.200:3000/book/add';
//   {
//     "id": "1548795654130",
//     "addName": "test",
//     "addLastname": "test",
//     "addAddress": "test",
//     "addAge": 20,
//     "addPhone": "0849654128"
// }
  const [id, setId] = useState('');
  const [addName, setAddName] = useState('');
  const [addLastname, setAddLastname] = useState('');
  const [addAddress, setAddAddress] = useState('');
  const [addAge, setAddAge] = useState('');
  const [addPhone, setAddPhone] = useState('');

  const [addAmount, setAddAmount] = useState('');
  const [addHouseFK, setAddHouseFK] = useState('');
  const [addUserFK, setAddUserFK] = useState('');
  const addUser = async () => {
    const data1 = {
      id: id,
      addName: addName,
      addLastname: addLastname,
      addAddress: addAddress,
      addAge: addAge,
      addPhone: addPhone
      
    };
    const data2 = {
        addAmount: addName,
        addHouseFK: addLastname,
        addUserFK: addAddress,
      };

    try {
      const response = await axios.post(House_API1, data1);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }

  try {
    const response = await axios.post(House_API2, data2);
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
    navigate('/Booking');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">

        <div>
            <label htmlFor="id" className="form-label">
              เลขบัตรประชาชน
            </label>
            <input
              type="text"
              className="form-control"
              id="id"
              value={id}
              onChange={(e) => setId(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addName" className="form-label">
              ชื่อ
            </label>
            <input
              type="text"
              className="form-control"
              id="addName"
              value={addName}
              onChange={(e) => setAddName(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addLastname" className="form-label">
              นามสกุล
            </label>
            <input
              type="text"
              className="form-control"
              id="addLastname"
              value={addLastname}
              onChange={(e) => setAddLastname(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addAddress" className="form-label">
              ที่อยู่
            </label>
            <input
              type="text"
              className="form-control"
              id="addAddress"
              value={addAddress}
              onChange={(e) => setAddAddress(e.target.value)}
            />
          </div>
         
          <div>
            <label htmlFor="addAge" className="form-label">
              อายุ
            </label>
            <input
              type="text"
              className="form-control"
              id="addAge"
              value={addAge}
              onChange={(e) => setAddAge(e.target.value)}
            />
          </div>

          <div>
            <label htmlFor="addPhone" className="form-label">
              เบอร์โทร
            </label>
            <input
              type="text"
              className="form-control"
              id="addPhone"
              value={addPhone}
              onChange={(e) => setAddPhone(e.target.value)}
            />
          </div>
         
        </div>

        <div className="form-group">
          <label>เลขการจอง</label>
          <input
            type="text"
            className="form-control"
            value={id}
            onChange={(e) => setId(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label>ราคา</label>
          <input
            type="text"
            className="form-control"
            value={newAmount}
            onChange={(e) => setNewAmount(e.target.value)}
          />
        </div>
      
        <div className="form-group">
          <label>บ้านเลขที่</label>
          <input
            type="text"
            className="form-control"
            value={newHouseFK}
            onChange={(e) => setNewHouseFK(e.target.value)}
          />
        </div>
  
        <div className="form-group">
          <label>เลขบัตรประชาชนผู้จอง</label>
          <input
            type="text"
            className="form-control"
            value={newUserFK}
            onChange={(e) => setNewUserFK(e.target.value)}
          />
        </div>

        <button type="button" className="btn btn-primary" onClick={addUser}>
          เพิ่มโซน
        </button>
      </form>
    </div>
  );
};

export default AddBooking;
